wwv_flow_api.create_page_plug(
 p_id=>wwv_flow_api.id(23673371149868838)
,p_plug_name=>'On Lose Focus Dynamic Action - Per Item'
,p_region_template_options=>'#DEFAULT#:js-useLocalStorage:is-collapsed:t-Region--scrollBody'
,p_plug_template=>wwv_flow_api.id(23055953720517693)
,p_plug_display_sequence=>20
,p_include_in_reg_disp_sel_yn=>'Y'
,p_plug_display_point=>'BODY'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'For P3_TEXT: (For other items, all that changes is the REGEXP)',
'<code>',
'var textitem = apex.item(this.triggeringElement.id),',
'     errors = [],',
'     alphanum = /^[0-9a-zA-Z]+$/;',
'     val = textitem.getValue();',
'',
'// Perform Validation: Check if alphanumeric',
' if (val.length > 0 && val.match(alphanum) ) {',
'     textitem.node.setCustomValidity(""); // valid',
' } else {',
'     textitem.node.setCustomValidity("Invalid"); // rely on data-valid-message attribute to give nice message',
' }',
'',
'// Raise/clear errors based on validity',
' if (!textitem.getValidity().valid) {',
'     errors.push({',
'         message: textitem.getValidationMessage(),',
'         location: ["page","inline"],',
'         pageItem: textitem.id',
'     });',
'     apex.message.showErrors(errors);',
' } else {',
'     apex.message.clearErrors(textitem.id);',
' }',
'',
'</code>'))
,p_plug_query_options=>'DERIVED_REPORT_COLUMNS'
,p_attribute_01=>'N'
,p_attribute_02=>'HTML'
);
wwv_flow_api.create_page_plug(
 p_id=>wwv_flow_api.id(23673435278868839)
,p_plug_name=>'Before Submit Dynamic Action - All Items'
,p_region_template_options=>'#DEFAULT#:js-useLocalStorage:is-collapsed:t-Region--scrollBody'
,p_plug_template=>wwv_flow_api.id(23055953720517693)
,p_plug_display_sequence=>30
,p_include_in_reg_disp_sel_yn=>'Y'
,p_plug_new_grid_row=>false
,p_plug_display_point=>'BODY'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'Or Validate All Items, Before Submit, in one Dynamic Action.',
'<code>',
'// Validate Items',
'apex.event.trigger("#P3_NUMBER","change")',
'',
'if (!apex.item("P3_NUMBER").getValidity().valid)',
'{',
'    apex.event.gCancelFlag = true;',
'    apex.message.showErrors({',
'        type:       "error",',
'        location:   ["inline","page"],',
'        pageItem:  "P3_NUMBER",',
'        message:    apex.item("P3_NUMBER").getValidationMessage(),',
'        unsafe:     false',
'    });',
'',
'}',
'apex.event.trigger("#P3_TEXT","change")',
'',
'if (!apex.item("P3_TEXT").getValidity().valid)',
'{',
'    apex.event.gCancelFlag = true;',
'    apex.message.showErrors({',
'        type:       "error",',
'        location:   ["inline","page"],',
'        pageItem:  "P3_TEXT",',
'        message:    apex.item("P3_TEXT").getValidationMessage(),',
'        unsafe:     false',
'    });',
'',
'}',
'apex.event.trigger("#P3_PHONE_NUMBER","change")',
'',
'if (!apex.item("P3_TEXT").getValidity().valid)',
'{',
'    apex.event.gCancelFlag = true;',
'    apex.message.showErrors({',
'        type:       "error",',
'        location:   ["inline","page"],',
'        pageItem:  "P3_PHONE_NUMBER",',
'        message:    apex.item("P3_PHONE_NUMBER").getValidationMessage(),',
'        unsafe:     false',
'    });',
'',
'}',
'',
'',
'',
'</code>'))
,p_plug_query_options=>'DERIVED_REPORT_COLUMNS'
,p_attribute_01=>'N'
,p_attribute_02=>'HTML'
);
