'<p style="padding-top:10px;">Using Client-Side Validations only potentially leaves a hole - depending on the item settings, and how and when the page gets submitted.',
'</p>',
'<p>Our NUMBER item has inconsistent bounds checks, no declared range, and no server-side validation.<br>',
'We can get by the Client Side Validations by simply using a Dynamic Action <strong>Submit Page</strong> or. an <strong>apex.submit</strong>',
'<p>',
'Recommendation is to include both Client-Side and Server-Side validations<br>',
'Add a Minimum and Maximum value for the number field, AND<br>',
'Turn the Server Side P16_NUMBER Validation on to see the improvement.',
'OR<br>',
'Use a Before-Submit JS Validation to make sure those Client-Side validations all pass. (next page)',
'</p><p>',
'<p>Do not forget to synchronize your Client and  Server-Side error messages - Be Consistent!</p>'))
